import React from 'react';
import Welcome from '../../Welcome';
import {homeObjOne, workObjOne, workObjTwo, workObjThree} from './Data';


function Home() {
    return (
        <>
            <Welcome {...homeObjOne} />
            <Welcome {...workObjOne} />
            <Welcome {...workObjTwo} />
            <Welcome {...workObjThree} />
            

        </>
    );
}

export default Home;
